import React from 'react';
import './styles/Header.css'
const Header = () => {
    return (
        <header className="header">
            <img src="https://upload.wikimedia.org/wikipedia/commons/b/be/Lineage_OS_Logo.png" alt="" className="logo" />
            <input type="text" className="search" />
            <input type="button" className="logout" />
        </header>
    )
}

export default Header;
